import React from 'react'
import { View, Text, Button } from 'react-native'
import Icon from "react-native-elements";

const PendingScreenView = (props) => {
  const { handleBtnPress } = props;
  return (
    <View>
      <Text>PendingScreenView</Text>
      {/* <Button title='Press me to go to next screen' omPress={() => navigation.navigate('Login')}/> */}
      <Icon name="clock" type="material-community" />
      <Button
        title="Go to Profile"
        onPress={() => handleBtnPress() }
      />
    </View>
  )
}

export default PendingScreenView
